import React from 'react'
import {Nav, NavLink} from './NavbarElement';
import mainlogo from './shoppinglogo.png'
function Navbar(props) {
    return (
        <Nav>
            <NavLink to='/'>
            <img src = {mainlogo} alt = "logo" width="80" height="80"/>Shopping Website
            </NavLink>

          <NavLink to='/' activeStyle>
            Cart  &nbsp;&nbsp;
          {props.countCartItems ? (<button className="badge">{props.countCartItems}</button>) : 
          (<button className="badge">0</button>)}
          </NavLink>
        </Nav>
    )
}

export default Navbar
